ubscriber:mail] from the [simplenews-newsletter:name] mailing list on [site:name] website at [site:url]. However, this email is not subscribed to this mailing list. If you intended to subscribe please visit our site at [site:url]\";s:24:\"confirm_combined_subject\";s:28:\"Confirmation for [site:name]\";s:21:\"confirm_combined_body\";s:212:\"We have received a request for the following subscription changes for [simplenews-subscriber:mail] at [site:url]:\r\n\r\n[changes-list]\r\n\r\nTo confirm please use the link below.\r\n\r\n[simplenews-subscriber:combined-url]\";s:31:\"confirm_combined_body_unchanged\";s:215:\"We have received a request for the following subscription changes for [simplenews-subscriber:mail] at [site:url]:\r\n\r\n[changes-list]\r\n\r\nNo confirmation necessary because all requested changes equal the current state.\";s:44:\"confirm_combined_line_subscribe_unsubscribed\";s:41:\"Subscribe to [simplenews-newsletter:name]\";s:42:\"confirm_combined_line_subscribe_subscribed\";s:50:\"Already subscribed to [simplenews-newsletter:name]\";s:44:\"confirm_combined_line_unsubscribe_subscribed\";s:45:\"Unsubscribe from [simplenews-newsletter:name]\";s:46:\"confirm_combined_line_unsubscribe_unsubscribed\";s:54:\"Already unsubscribed from [simplenews-newsletter:name]\";}}'),('language.en','system.action.comment_publish_action','a:1:{s:5:\"label\";s:15:\"Publish comment\";}'),('language.en','system.action.comment_save_action','a:1:{s:5:\"label\";s:12:\"Save comment\";}'),('language.en','system.action.comment_unpublish_action','a:1:{s:5:\"label\";s:17:\"Unpublish comment\";}'),('language.en','system.action.node_delete_action','a:1:{s:5:\"label\";s:14:\"Delete content\";}'),('language.en','system.action.node_make_sticky_action','a:1:{s:5:\"label\";s:19:\"Make content sticky\";}'),('language.en','system.action.node_make_unsticky_action','a:1:{s:5:\"label\";s:21:\"Make content unsticky\";}'),('language.en','system.action.node_promote_action','a:1:{s:5:\"label\";s:29:\"P