og in and will lead you to a page where you can set your password. It expires after one day and nothing will happen if it\'s not used.\n\n--  [site:name] team','','8.2.1'),(4778,'Replacement login information for [user:display-name] at [site:name]','','8.2.1'),(4779,'[user:display-name],\n\nA site administrator at [site:name] has created an account for you. You may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:name]\npassword: Your password\n\n--  [site:name] team','','8.2.1'),(4780,'[user:display-name],\n\nThank you for registering at [site:name]. You may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:name]\npassword: Your password\n\n--  [site:name] team','','8.2.1'),(4781,'Account details for [user:display-name] at [site:name]','','8.2.1'),(4782,'[user:display-name],\n\nThank you for registering at [site:name]. Your application for an account is currently pending approval. Once it has been approved, you will receive another email containing information about how to log in, set your password, and other details.\n\n\n--  [site:name] team','','8.2.1'),(4783,'Account details for [user:display-name] at [site:name] (pending admin approval)','','8.2.1'),(4784,'[user:display-name] has applied for an account.\n\n[user:edit-url]','','8.2.1'),(4785,'[user:display-name],\n\nYour account at [site:name] has been activated.\n\nYou may now log in by clicking this link or copying and pasting it into your browser:\n\n[user:one-time-login-url]\n\nThis link can only be used once to log in and will lead you to a page where you can set your password.\n\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\n\nusername: [user:account-name]\npassword: Your password\n\n--  [site:name] team','','8.2.1'),(4786,'Account details for [user:display-name] at [site:name] (approved)','','8.2.1'),(4787,'[user:display-name],\n\nYour account on [site:name] has been blocked.\n\n--  [site:name] team','','8.2.1'),(4788,'Account details for [user:display-name] at [site:name] (blocked)','','8.2.1'),(4789,'[user:display-name],\n\nYour account on [site:name] has been canceled.\n\n--  [site:name] team','','8.2.1'),(4790,'Account details for [user:display-name] at [site:name] (canceled)','','8.2.1'),(4791,'Authenticated user','','8.2.1'),(4792,'Find and manage custom blocks.','','8.2.1'),(4793,'‹ Previous','','8.2.1'),(4794,', ','','8.2.1'),(4795,'There are no custom blocks available. ','','8.2.1'),(4796,'Recent comments.','','8.2.1'),(4797,'Find and manage files.','','8.2.1'),(4798,'Fid','','8.2.1'),(4799,'1 place@count places','','8.2.1'),(4800,'Files overview','','8.2.1'),(4801,'Registering module','','8.2.1'),(4802,'1@count','','8.2.1'),(4803,'File usage information for {{ arguments.fid }}','','8.2.1'),(4804,'<p>This page provides the ability to add common languages to your site.</p><p>If the desired language is not available, you can add a custom language.</p>','','8.2.1'),(4805,'Select language','','8.2.1'),(4806,'<p>Choose a language from the list, or choose \"Custom language...\" at the end of the list.</p><p>Click the \"Add language\" button when you are done choosing your language.</p><p>When adding a custom language, you will get an additional form where you can provide the name, code, and direction of the language.</p>','','8.2.1'),(4807,'Continuing on','','8.2.1'),(4808,'<p>Now that you have an overview of the \"Add languages\" feature, you can continue by:<ul><li>Adding a language</li><li>Adding a custom language</li><li><a href=\"[site:url]/admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.2.1'),(4809,'Editing languages','','8.2.1'),(4810,'<p>This page provides the ability to edit a language on your site, including custom languages.</p>','','8.2.1'),(4811,'<p>You cannot change the code of a language on the site, since it is used by the system to keep track of the language.</p>','','8.2.1'),(4812,'<p>The language name is used throughout the site for all users and is written in English. Names of built-in languages can be translated using the Interface Translation module, and names of both built-in and custom languages can be translated using the Configuration Translation module.</p>','','8.2.1'),(4813,'Language direction','','8.2.1'),(4814,'<p>Choose if the language is a \"Left to right\" or \"Right to left\" language.</p><p>Note that not all themes support \"Right to left\" layouts, so test your theme if you are using \"Right to left\".</p>','','8.2.1'),(4815,'<p>Now that you have an overview of the \"Edit language\" feature, you can continue by:<ul><li>Editing a language</li><li><a href=\"[site:url]/admin/config/regional/language\">Viewing configured languages</a></li></ul></p>','','8.2.1'),(4816,'<p>The \"Languages\" page allows you to add, edit, delete, and reorder languages for the site.</p>','','8.2.1'),(4817,'<p>To add more languages to your site, click the \"Add language\" button.</p><p>Added languages will be displayed in the language list and can then be edited or deleted.</p>','','8.2.1'),(4818,'Reordering languages','','8.2.1'),(4819,'<p>To reorder the languages on your site, use the drag icons next to each language.</p><p>The order shown here is the display order for language lists on the site such as in the language switcher blocks provided by the Interface Translation and Content Translation modules.</p><p>When you are done with reordering the languages, click the \"Save configuration\" button for the changes to take effect.</p>','','8.2.1'),(4820,'Set a language as default','','8.2.1'),(4821,'<p>You can change the default language of the site by choosing one of your configured languages as default. The site will use the default language in situations where no choice is made but a language should be set, for example as the language of the displayed interface.</p>','','8.2.1'),(4822,'Modifying languages','','8.2.1'),(4823,'<p>Operations are provided for editing and deleting your languages.</p><p>You can edit the name and the direction of the language.</p><p>Deleted languages can be added back at a later time. Deleting a language will remove all interface translations associated with it, and content in this language will be set to be language neutral. Note that you cannot delete the default language of the site.</p>','','8.2.1'),(4824,'<p>Now that you have an overview of the \"Languages\" page, you can continue by:<ul><li><a href=\"[site:url]/admin/config/regional/language/add\">Adding a language</a></li><li>Reordering languages</li><li>Editing a language</li><li>Deleting a language</li></ul></p>','','8.2.1'),(4825,'User interface translation','','8.2.1'),(4826,'This page allows you to translate the user interface or modify existing translations. If you have installed your site initially in English, you must first add another language on the <a href=\"[site:url]/admin/config/regional/language\">Languages page</a>, in order to use this page.','','8.2.1'),(4827,'Choose the language you want to translate.','','8.2.1'),(4828,'Enter the specific word or sentence you want to translate, you can also write just a part of a word.','','8.2.1'),(4829,'Filter the search','','8.2.1'),(4830,'You can search for untranslated strings if you want to translate something that isn\'t translated yet. If you want to modify an existing translation, you might want to search only for translated strings.','','8.2.1'),(4831,'Apply your search criteria','','8.2.1'),(4832,'To apply your search criteria, click on the <em>Filter</em> button.','','8.2.1'),(4833,'You can write your own translation in the text fields of the right column. Try to figure out in which context the text will be used in order to translate it in the appropriate way.','','8.2.1'),(4834,'Validate the translation','','8.2.1'),(4835,'When you have finished your translations, click on the <em>Save translations</em> button. You must save your translations, each time before changing the page or making a new search.','','8.2.1'),(4836,'The translations you have made here will be used on your site\'s user interface. If you want to use them on another site or modify them on an external translation editor, you can <a href=\"[site:url]/admin/config/regional/translate/export\">export them</a> to a .po file and <a href=\"[site:url]/admin/config/regional/translate/import\">import them</a> later.','','8.2.1'),(4837,'All content, by month.','','8.2.1'),(4838,'{{ arguments.created_year_month }}','','8.2.1'),(4839,'« First','','8.2.1'),(4840,'Last »','','8.2.1'),(4841,'Find and manage content','','8.2.1'),(4842,'Recent content.','','8.2.1'),(4843,'All content promoted to the front page.','','8.2.1'),(4844,'Welcome to [site:name]','','8.2.1'),(4845,'Glossary','','8.2.1'),(4846,'All content, by letter.','','8.2.1'),(4847,'Content belonging to a certain taxonomy term.','','8.2.1'),(4848,'{{ arguments.tid }}','','8.2.1'),(4849,'Name or email contains','','8.2.1'),(4850,'Shows a list of the newest user accounts on the site.','','8.2.1'),(4851,'A list of new users','','8.2.1'),(4852,'Who\'s online block','','8.2.1'),(4853,'Shows the user names of the most recently active users, and the total number of active users.','','8.2.1'),(4854,'There are currently @total users online.','','8.2.1'),(4855,'There are currently 0 users online.','','8.2.1'),(4856,'A list of users that are currently logged in.','','8.2.1'),(4857,'View edit page','','8.2.1'),(4858,'Manage view settings