2.1'),(5583,'Enable @title language detection method','','8.2.1'),(5584,'Weight for @title language detection method','','8.2.1'),(5585,'Define how to decide which language is used to display page elements (primarily text provided by modules, such as field labels and help text). This decision is made by evaluating a series of detection methods for languages; the first detection method that gets a result will determine which language is used for that type of text. Be aware that some language detection methods are unreliable under certain conditions, such as browser detection when page-caching is enabled and a user is not currently logged in. Define the order of evaluation of language detection methods on this page. The default language can be changed in the <a href=\":admin-change-language\">list of languages</a>.','','8.2.1'),(5586,'Check for updates of uninstalled modules and themes','','8.2.1'),(5587,'Email addresses to notify when updates are available','','8.2.1'),(5588,'Whenever your site checks for available updates and finds new releases, it can notify a list of users via email. Put each address on a separate line. If blank, no emails will be sent.','','8.2.1'),(5589,'Email notification threshold','','8.2.1'),(5590,'You can choose to send email only if a security update is available, or to be notified about all newer versions. If there are updates available of Drupal core or any of your installed modules and themes, your site will always print a message on the <a href=\":status_report\">status report</a> page, and will also display an error message on administration pages if there is a security update.','','8.2.1'),(5591,'Update Manager settings','','8.2.1'),(5592,'Manually entered paths should start with /, ? or #.','','8.2.1'),(5593,'Calendar legend','','8.2.1'),(5594,'Legend View','','8.2.1'),(5595,'Choose the view display that contains the settings for the stripes that should be displayed in a legend in this block. Note that if you change the stripe values in that view you will need to clear the cache to pick up the new values in this block.','','8.2.1'),(5596,'The view for the calendar legend has been set.','','8.2.1'),(5597,'For more information see W3C\'s <a href=\":html-specifications\">HTML Specifications</a> or use your favorite search engine to find other sites that explain HTML.','','8.2.1'),(5598,'If you do encounter problems, try using HTML character entities. A common example looks like &amp;amp; for an ampersand &amp; character. For a full list of entities see HTML\'s <a href=\":html-entities\">entities</a> page. Some of the available characters include:','','8.2.1'),(5599,'\n        <p>You can align images, videos, blockquotes and so on to the left, right or center. Examples:</p>\n        <ul>\n          <li>Align an image to the left: <code>&lt;img src=\"\" data-align=\"left\" /&gt;</code></li>\n          <li>Align an image to the center: <code>&lt;img src=\"\" data-align=\"center\" /&gt;</code></li>\n          <li>Align an image to the right: <code>&lt;img src=\"\" data-align=\"right\" /&gt;</code></li>\n          <li>… and you can apply this to other elements as well: <code>&lt;video src=\"\" data-align=\"center\" /&gt;</code></li>\n        </ul>','','8.2.1'),(5600,'\n        <p>You can caption images, videos, blockquotes, and so on. Examples:</p>\n        <ul>\n            <li><code>&lt;img src=\"\" data-caption=\"This is a caption\" /&gt;</code></li>\n            <li><code>&lt;video src=\"\" data-caption=\"The Drupal Dance\" /&gt;</code></li>\n            <li><code>&lt;blockquote data-caption=\"Dries Buytaert\"&gt;Drupal is awesome!&lt;/blockquote&gt;</code></li>\n            <li><code>&lt;code data-caption=\"Hello world in JavaScript.\"&gt;alert(\"Hello world!\");&lt;/code&gt;</code></li>\n        </ul>','','8.2.1'),(5601,'Only images hosted on this site may be used in &lt;img&gt; tags.','','8.2.1'),(5602,'Lines and paragraphs are automatically recognized. The &lt;br /&gt; line break, &lt;p&gt; pa